import React, {Component} from "react";

class Ranklist extends Component{
    render() {
        return(
            <>
                <div className="img-wrap">
                    <span
                        className="lazyload-img hotzone-pic lazyload-img-wmh size50 transparent big-width loaded"
                        data-resize="1" style={{backgroundColor: 'transparent', backgroundImage: 'none',}}>热卖榜单</span>
                </div>
            </>
        );
    }
}
export default Ranklist
